import React from 'react';
import FinancialStats from './FinancialStats';
import { DollarSign, TrendingUp, Calendar, Users } from 'lucide-react';
import './FinancePage.css';

interface Transaction {
  id: string;
  type: 'income' | 'expense';
  amount: number;
  category: string;
  description: string;
  date: Date;
  userId?: string;
  username?: string;
}

interface User {
  id: string;
  username: string;
  display_name: string;
  email?: string;
  created_at: string;
}

interface FinancePageProps {
  transactions?: Transaction[];
  users?: User[];
  currentUser?: User | null;
}

const FinancePage: React.FC<FinancePageProps> = ({ transactions = [], users = [], currentUser }) => {
  // Sort transactions by date (newest first)
  const sortedTransactions = [...transactions].sort((a, b) => 
    new Date(b.date).getTime() - new Date(a.date).getTime()
  );

  // Group transactions by user
  const transactionsByUser = transactions.reduce((acc, transaction) => {
    const username = transaction.username || 'Unknown';
    if (!acc[username]) {
      acc[username] = [];
    }
    acc[username].push(transaction);
    return acc;
  }, {} as Record<string, Transaction[]>);

  return (
    <div className="finance-page">
      <div className="finance-header">
        <h1>Finance Dashboard</h1>
        <p>Track financial health and spending patterns across all users</p>
        {currentUser && (
          <div className="current-user-info">
            <Users size={16} />
            <span>Currently viewing: {currentUser.display_name}</span>
          </div>
        )}
      </div>
      
      <div className="finance-content">
        <FinancialStats transactions={transactions} />
        
        {/* User Summary Section */}
        {Object.keys(transactionsByUser).length > 0 && (
          <div className="users-summary-section">
            <h2>Financial Summary by User</h2>
            <div className="users-summary-grid">
              {Object.entries(transactionsByUser).map(([username, userTransactions]) => {
                const userIncome = userTransactions
                  .filter(t => t.type === 'income')
                  .reduce((sum, t) => sum + t.amount, 0);
                const userExpenses = userTransactions
                  .filter(t => t.type === 'expense')
                  .reduce((sum, t) => sum + t.amount, 0);
                const userBalance = userIncome - userExpenses;

                return (
                  <div key={username} className="user-summary-card">
                    <div className="user-summary-header">
                      <Users size={20} />
                      <span className="user-name">{username}</span>
                    </div>
                    <div className="user-summary-stats">
                      <div className="stat">
                        <span className="stat-label">Income</span>
                        <span className="stat-value income">+${userIncome.toFixed(2)}</span>
                      </div>
                      <div className="stat">
                        <span className="stat-label">Expenses</span>
                        <span className="stat-value expense">-${userExpenses.toFixed(2)}</span>
                      </div>
                      <div className="stat">
                        <span className="stat-label">Balance</span>
                        <span className={`stat-value ${userBalance >= 0 ? 'positive' : 'negative'}`}>
                          {userBalance >= 0 ? '+' : ''}${userBalance.toFixed(2)}
                        </span>
                      </div>
                    </div>
                    <div className="user-transaction-count">
                      {userTransactions.length} transactions
                    </div>
                  </div>
                );
              })}
            </div>
          </div>
        )}
        
        <div className="transactions-section">
          <h2>Recent Transactions</h2>
          {sortedTransactions.length > 0 ? (
            <div className="transactions-list">
              {sortedTransactions.map((transaction) => (
                <div key={transaction.id} className={`transaction-item ${transaction.type}`}>
                  <div className="transaction-icon">
                    {transaction.type === 'income' ? (
                      <TrendingUp size={20} />
                    ) : (
                      <DollarSign size={20} />
                    )}
                  </div>
                  <div className="transaction-details">
                    <div className="transaction-description">{transaction.description}</div>
                    <div className="transaction-category">{transaction.category}</div>
                    {transaction.username && (
                      <div className="transaction-user">@{transaction.username}</div>
                    )}
                    <div className="transaction-date">
                      <Calendar size={14} />
                      {new Date(transaction.date).toLocaleDateString()}
                    </div>
                  </div>
                  <div className={`transaction-amount ${transaction.type}`}>
                    {transaction.type === 'income' ? '+' : '-'}${transaction.amount.toFixed(2)}
                  </div>
                </div>
              ))}
            </div>
          ) : (
            <div className="no-transactions">
              <p>No transactions recorded yet. Start by telling ANITA about your income or expenses!</p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default FinancePage;
